import React from 'react';
import { useNavigate, Link } from 'react-router-dom';
import './style.css';
import '@fortawesome/fontawesome-free/css/all.min.css';

const HomePage = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    navigate("/");
  };

  return (
    <div className="home-container">
      <div className="search-bar-container">
        <input
          type="text"
          className="search-bar"
          placeholder="Search..."
        />
      </div>
      <div className="sidebar">
        <div className="sidebar-icon">
          <Link to="/NewsApp/news"><i className="fas fa-search"></i></Link>
        </div>
        <div className="sidebar-icon">
          <Link to="/add-note"><i className="fas fa-users"></i></Link>
          <span className="badge">10K+</span>
        </div>
        <div className="sidebar-icon">
          <Link to="/bot"><i className="fas fa-bug"></i></Link>
        </div>
        <div className="sidebar-icon">
          <i className="fas fa-th"></i>
        </div>
        <div className="sidebar-icon">
          <Link to="/weather"><i className="fas fa-tree"></i></Link>
        </div>
        <div className="sidebar-icon">
          <button onClick={handleLogout} style={{ background: "none", border: "none", cursor: "pointer" }}>
            <i className="fas fa-sign-out-alt" style={{ color: "white" }}></i>
          </button>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
